INSERT INTO `Posts` (`id`,`title`,`country`,`city`,`lodging`,`ratings`,`activities`,`body`,`imgTitle`,`imageURL`,`createdAt`,`updatedAt`,`TravelerId`) VALUES (6,'Oooh Chanselisee','France','Paris','A Park Bench',8,'Seeing the Eiffel Tower','La chaux chimique est produite par extraction sélective de CaCO3 chimiquement pur dans les mines et carrières. Tout au long du procédé de fabrication, Graymont surveille attentivement le procédé de façon à produire une chaux calcique vive qui est fortement réactive et surface particulaire élevée. La chaux chimique fournit un rendement exceptionnel pour la neutralisation de l\'acidité, la désulfuration des gaz de combustion, la stabilisation des boues et d\'autres applications industrielles alcalines. La combinaison unique d\'une grande disponibilité du CaO, d\'une réactivité élevée et d\'une surface particulaire élevée signifie qu\'une moins grande quantité de chaux de Graymont est nécessaire pour « faire le travail » comparativement à d\'autres produits de chaux commercialisés.','Arc d Triumph','/assets/file_uploads/paris.jpg','2020-12-15 22:35:34','2020-12-15 22:35:34',5);
