INSERT INTO `Posts` (`id`,`title`,`country`,`city`,`lodging`,`ratings`,`activities`,`body`,`imgTitle`,`imageURL`,`createdAt`,`updatedAt`,`TravelerId`) VALUES (16,'Downtown Tokyo','Japan','Tokyo','Big Hotel',8,'Walking Downtown and Eating Sushi','エコロジーのために 堪え忍ぶのではな 自然と調和し た住環境の快適 性が必要である いよいよという 時に言葉が出ない インターネッ トのテクノロジーは日進月歩 いや 秒進分歩で進歩している あんたらの名前なんか興味ない どうせこの仕事が終わるとお別れだ いつ神戸に来るのか教えて下さい 「あの音で考え事 ができないわ 彼女はタイプライターを 見つめながら言った と いいえ しか言わない人と会話 を続けるのは難しい。 エヴェレスト山は海抜２ フィートです 年は待つには長い時間だ イルカは人間に次 いで最も知能が高 やがては彼らとの対 話も夢ではないと考 えている科学者もいる','Tokyo City Lights','/assets/file_uploads/2020-03-24-tokyo-thumbnail-01.jpg','2020-12-15 17:05:54','2020-12-15 17:05:54',90);
